function FinalData(props) {
  const userInfo = [];
  //personalInfo
  userInfo.push(
    props.fname,
    props.fname,
    props.mail,
    props.number,
    props.language,
    props.experience,
    props.work,
    props.covidContact,
    props.covidDate,
    props.vacinatedDate,
    props.vaccinated,
    props.devTalks, props.aboutYou, props.speech
  );
  //Skills
  // userInfo.push(props.language, props.experience)
  /////CovidInfo
//   userInfo.push(
//     props.work,
//     props.covidContact,
//     props.covidDate,
//     props.vacinatedDate,
//     props.vaccinated
//   );
  //Insights
//   userInfo.push(props.devTalks, props.aboutYou, props.speech);

  // console.log(userInfo)
  // const arr =['Yes','no', 'Y','N','No']

  for (let i = 0; i < userInfo.length; i++) {
    if (userInfo[i] === "Y" || userInfo[i] === "Yes") {
      userInfo[i] = true;
    }
    if (userInfo[i] === "No" || userInfo[i] === "N") {
      userInfo[i] = false;
    }
  }
  console.log(userInfo);

  return null;
}
export default FinalData;
